import React from 'react'
import './Board.scss'
import Button from './Button'

class Board extends React.Component {
    render() {
        return (
            <>
                <Button>0</Button>
                <Button>1</Button>
                <Button>2</Button>
                <Button>3</Button>
                <Button>5</Button>
            </>
        )
    }
}

export default Board;
